import React from 'react';
import axios from 'axios';

class Albums extends React.Component{
    constructor(props){
        super(props)

        this.state = {
            albums : []
        }
    }

    componentDidMount(){
        axios('https://jsonplaceholder.typicode.com/albums')
    }
}

export default Albums
